import Select from "react-select";
import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import Image from "../../../../common/components/img/Img";
import DashbordBg from "../../../../../pics/hrbg.png";
import { NavLink } from "react-router-dom";
import DashbordBgIcon from "../../../../../pics/hrbgIcon.png";
export const HiringIndex = () => {
  return (
    <>
      <HiringIndexTop />
      <HiringIndexCard />
    </>
  );
};
const HiringIndexTop = () => {
  const options = [
    { value: "today", label: "today" },
    { value: "tomorrow", label: "tomorrow" },
    { value: "last week", label: "last week" },
  ];
  return (
    <>
      <div className=" mb-4">
        <div className="row HiringIndex_top_title">
          <div className="col-xxl-10 col-xl-10 col-lg-10 col-md-9 col-sm-6 col-6">
            <TopPageTitle Name="Hiring" />
          </div>
          <div className="col-xxl-2 col-xl-2 col-lg-2 col-md-3 col-sm-6 col-6">
            <div className="dashboard_top_week_Select">
              <Select options={options} placeholder="This week" />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
const HiringIndexCard = () => {
  return (
    <>
      <div className="row">
        <div className="col-8">
          <div className="row">
            <div className="col-6">
              <NavLink to="/">
                <div className="DashbordBg_img_div">
                  <Image
                    className="DashbordBg_img"
                    backgroundImage={DashbordBg}
                  />
                  <div className="DashbordBg_img_div_inner"></div>
                </div>
              </NavLink>
            </div>
            <div className="col-6">
              <div className="row">
                <div className="col-12">1</div>
                <div className="col-12">1</div>
              </div>
            </div>
          </div>
        </div>
        <div className="col-4">2</div>
      </div>
    </>
  );
};
